import logo from './logo.svg';
import {useState} from 'react';
import './App.css';

function App() {

  const [data, setData] = useState("No data!")

  function querySeed() {
    fetch("https://api.example.com/items")
      .then(res => res.json())
      .then(
        (result) => {
          setData(result);
        },
        (error) => {
         console.log("Error: "+error);
        }
      )
  }

  return (
    <div className="App">
      <h1>{data}</h1>
    </div>
  );
}

export default App;
